import React from "react";
import Particles from "react-tsparticles";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Particles
        options={{
          background: {
            color: {
              value: "#0d47a1", // Background color
            },
          },
          particles: {
            number: {
              value: 50,
            },
            size: {
              value: 3,
            },
            move: {
              enable: true,
              speed: 2,
            },
            shape: {
              type: "circle",
            },
          },
        }}
      />
      <header className="App-header">
        <h1>Welcome to My App</h1>
      </header>
    </div>
  );
}

export default App;
